import{_ as e,o,c as a,O as n}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 6.2-943 Offenses by officer, director, agent, or employee of bank; penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-943.md","filePath":"vacode/6.2-943.md"}'),t={name:"vacode/6.2-943.md"},r=n('<h1 id="§-6-2-943-offenses-by-officer-director-agent-or-employee-of-bank-penalties" tabindex="-1">§ 6.2-943 Offenses by officer, director, agent, or employee of bank; penalties. <a class="header-anchor" href="#§-6-2-943-offenses-by-officer-director-agent-or-employee-of-bank-penalties" aria-label="Permalink to &quot;§ 6.2-943 Offenses by officer, director, agent, or employee of bank; penalties.&quot;">​</a></h1><p>A. Any officer, director, agent, or employee of any bank who embezzles, abstracts, or willfully misapplies any of the moneys, funds, or credits of, or in the possession or control of, the bank is guilty of larceny and subject to the penalties provided in § <a href="http://law.lis.virginia.gov/vacode/18.2-95/" target="_blank" rel="noreferrer">18.2-95</a> or <a href="http://law.lis.virginia.gov/vacode/18.2-96/" target="_blank" rel="noreferrer">18.2-96</a>.</p><p>B. Any officer, director, agent, or employee of any bank who (i) issues or puts forth any certificate of deposit, (ii) draws any order or bill of exchange, (iii) makes any acceptance, (iv) assigns any note, bond, draft, bill of exchange, mortgage, judgment, decree, or other instrument in writing, or (v) makes any false entry in any book, report, or statement of such bank, with intent in any case to injure or defraud the bank or any other individual or entity, or to deceive any officer of the bank or the Commission, or any agent or examiner authorized to examine the affairs of the bank, and any person, who, with the same intent, aids or abets any such officer, director, agent, or employee of such bank in any act described in clauses (i) through (v), is guilty of a Class 5 felony.</p><p>C. Any officer of a bank who knowingly makes a false statement of the condition of any bank is guilty of a Class 5 felony.</p><p>Code 1950, §§ 6-128, 6-138; 1966, c. 584, § 6.1-122; 1974, c. 665; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',5),i=[r];function s(f,c,l,d,p,h){return o(),a("div",null,i)}const m=e(t,[["render",s]]);export{b as __pageData,m as default};
